import React from 'react';

function Iframe() {
    return (
      <div className="App">
        <h3>Iframes in React</h3>
        <iframe src="https://platform.twitter.com/widgets/tweet_button.html"></iframe>
      </div>
    );
  }
  
  export default Iframe;
